import styled from "styled-components";

export const Container = styled.div `
width: 100%;
height: 100vh;
background-color: #f5f7f9;
display: flex;
align-items:center;
justify-content: center;

`
export const Content = styled.div `
    background-color: #FFFFFF;
    width: 60%;
    min-height: 350px;
    border-radius: 16px;
    border: 1px solid #b4b9d9;




`
